style.css:
:root {
  --background-image: url('https://i.imgur.com/9JyPIke.jpeg');
  --background-image-blur: 4px;
  --background-image-size: 100%;
  --background-image-position: center;
  --popout-image: url('https://i.imgur.com/QqSCPo3.jpeg');
  --popout-image-blur: 4px;
  --popout-image-size: cover;
  --popout-image-position: center;
  --overlay-image: url('https://i.imgur.com/Kwzfspr.jpeg');
  --overlay-image-blur: 4px;
  --overlay-image-size: contain;
  --overlay-image-position: center;
  --home-button-image: url('https://i.imgur.com/kj1LCgE.jpeg');
  --home-button-size: 150%;
  --home-button-position: center;
  --serverlist-brightness: 0.8;
  --left-brightness: 0.8;
  --middle-brightness: 0.6;
  --right-brightness: 0;
  --overlay-brightness: 0.75;
  --gradient-primary: 77,52,32;
  --gradient-secondary: 117,94,60;
  --link-colour: #D3C098;
  --scrollbar-colour: rgb(224,220,255,0.05);
  --gradient-direction: 139deg;
  --tint-colour: 134,134,134;
  --tint-brightness: 0;
  --font: Nunito;
  --window-padding: 0px;
  --window-roundness: 0px;
  --update-notice-1: none;
}
